import './App.css';
import Navbar from './Components/Navbar';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
import Login from './Components/Login';

function App() {
  return (
    <>
    <Router>
    <Navbar/>

      <Routes>
      <Route path={"login"} exact element={<Login/>}/>
         <Route path={"login"} exact element={<Login/>}/>

       </Routes>
    </Router>
    </>
  );
}

export default App;
